import { BrowserRouter, Routes, Route, NavLink } from "react-router-dom";
import Layout from "./pages/Layout";
import Home from "./pages/Home";
import Blogs from "./pages/Blogs";
import Contact from "./pages/Contact";
import NoPage from "./pages/NoPage";
import FullPageIntroWithFixedNavbar from "./function";
import { Container } from "react-bootstrap";

export default function App() {
  return (
    <Container>
      <div id="mainListDiv" class="main_list">
        <ul class="navlinks">
            <li><NavLink to="/Home" href="#">Home</NavLink></li>
            <li><NavLink to="/blogs" href="#">Home</NavLink></li>
            <li><NavLink to="/contact" href="#">Home</NavLink></li>
        </ul>
      </div>
      <article className="main">
     <Route path="/" exact component={Blogs} />
     <Route path="/Home" component={Blogs} />
     <Route path="/blogs" component={Blogs} />
     <Route component={NotFound}/>
</article>
    </Container>
      
  );
}
